DROP TRIGGER IF EXISTS `valida_fecha_boletos`;
DELIMITER //
CREATE TRIGGER `valida_fecha_boletos` BEFORE UPDATE ON `fulfillment_branch_office_goals`
 FOR EACH ROW BEGIN

DECLARE fechaValida date;
DECLARE msg varchar(255);

SELECT DATE_ADD(max(fecha_fin), INTERVAL 1 DAY) FROM `fulfillment_branch_office_goals` where cantidad_boletos IS NOT NULL INTO fechaValida;

IF NEW.fecha_inicio <> fechaValida THEN
	set msg = concat('El rango de fechas introducidos no es valido, la fecha inicial debe ser ', cast(fechaValida as date));
        signal sqlstate '45000' set message_text = msg;
END IF;

END
//
DELIMITER ;
