DROP TRIGGER IF EXISTS `valida_fecha_proveedores`;
DELIMITER //
CREATE TRIGGER `valida_fecha_proveedores` BEFORE INSERT ON `services_sales_providers`
 FOR EACH ROW BEGIN

DECLARE fechaValida date;
DECLARE msg varchar(255);

SELECT DATE_ADD(max(fecha_fin_proveedor), INTERVAL 1 DAY) FROM `services_sales_providers` INTO fechaValida;

IF NEW.fecha_inicio_proveedor <> fechaValida THEN
	set msg = concat('El rango de fechas introducidos no es valido, la fecha inicial debe ser ', cast(fechaValida as date));
        signal sqlstate '45000' set message_text = msg;
END IF;

END
//
DELIMITER ;

